from typing import List
class Solution:
    def asteroidCollision(self, asteroids: List[int]) -> List[int]:
        stack = list()
        for x in asteroids:
            if not stack:
                stack.append(x)
            elif x > 0:
                stack.append(x)
            elif stack[-1] < 0:
                stack.append(x)
            else:
                addToStack = True
                while stack and stack[-1] > 0:
                    if abs(stack[-1]) > abs(x):
                        addToStack = False
                        break
                    elif abs(stack[-1]) < abs(x):
                        stack.pop()
                    else:
                        stack.pop()
                        addToStack = False
                        break
                if addToStack:
                    stack.append(x)
        return stack

